for line in sys.stdin:
    line = line.strip()
    matrix = eval(line)

    # Score each cell based on if their closer to English or Dutch
    enscore = 0
    nlscore = 0
    for i in 'abcdefghijklmnopqrstuvwxyz $':
        for j in 'abcdefghijklmnopqrstuvwxyz $':
            if matrix[i][j] != 0:
                endiff = abs(matrix[i][j] - enmatrix[i][j])
                nldiff = abs(matrix[i][j] - nlmatrix[i][j])
                if endiff > nldiff:
                    nlscore += 1
                else:
                    enscore += 1

    # Compare the scores and based on which is higher, return the string
    if nlscore > enscore:
        output = 'nl'
    else:
        output = 'en'

    print ('%s\t%s' % (output, 1))